import React, {Component} from 'react';

import Card, { CardHeader, CardMedia, CardContent } from 'material-ui/Card';
import Divider from 'material-ui/Divider';
import Typography from 'material-ui/Typography';

import {socket} from './../../Socket';
import {_globals} from './../../Globals';

export default class Stream extends Component {
  constructor() {
    super();

    this.state = {
      watching: false,
      viewers: 0,
      frame: "data:image/png;base64,"
    };

    socket.on('frame', (data) => {
      // data = base64 IMG
      console.log(data);
      this.setState({frame: data});
    });

    socket.on('viewers', (amount) => this.setState({viewers: amount}));
  }

  componentDidMount() {
    this.refs.video.addEventListener('play', this.play);
    this.refs.video.addEventListener('pause', this.stop);
  }

  componentWillUnmount() {
    //this.refs.video.removeEventListener('play');
    //this.refs.video.removeEventListener('pause');
  }

  play() {
    console.log('Play');
    socket.emit('play_stream', { id: _globals.selectedId });
  }

  stop() {
    console.log('Stop');
    socket.emit('stop_stream', { id: _globals.selectedId });
  }

  render() {
    return (
      <Card style={{marginBottom: 20}}>
        <CardHeader title="Streaming" subheader="Realtime screen sharing with client" style={{textAlign: 'center'}}  />
        <Divider />
        <CardMedia>
          <video ref="video" poster={this.state.frame} style={{maxWidth: '100%'}} controls></video>
        </CardMedia>
        <CardContent style={{height: 58}}>
          <Typography type="subheading" align="right">
            {this.state.viewers} watching now
          </Typography>
          <Typography type="caption" align="right">
            85kb/s, 60FPS
          </Typography>
        </CardContent>
      </Card>
    );
  }
}